TITLE:
  - "Test for line-based coupling between artery network (including"
  - "scalar transport) and PoroMultiphaseScatra-Framework."
  - "Mortar Penalty coupling method is employed"
PROBLEM SIZE:
  DIM: 2
PROBLEM TYPE:
  PROBLEMTYPE: porofluid_pressure_based_elasticity_scatra
porofluid_elasticity_scatra_dynamic:
  total_simulation_time: 10
  time_integration:
    time_step_size: 0.1
    number_of_time_steps: 10
    theta: 1.0
  artery_coupling_active: true
  coupling_scheme: twoway_monolithic
porofluid_elasticity_scatra_dynamic/monolithic:
  nonlinear_solver:
    linear_solver_id: 1
    residual:
      global_tolerance: 1e-07
    increment:
      global_tolerance: 1e-07
STRUCTURAL DYNAMIC:
  INT_STRATEGY: "Standard"
  DYNAMICTYPE: "OneStepTheta"
  LINEAR_SOLVER: 2
STRUCTURAL DYNAMIC/ONESTEPTHETA:
  THETA: 1
porofluid_elasticity_dynamic:
  coupling_scheme: twoway_monolithic
porofluid_dynamic:
  initial_condition:
    type: by_function
    function_id: 1
porofluid_dynamic/artery_coupling:
  coupling_method: gauss_point_to_segment
  reaction_terms:
    artery_function_ids: "10"
    artery_scaling: "-1"
    homogenized_function_ids: "0 0 12 0 0"
    homogenized_scaling: "0 0 1 0 0"
  evaluate_in_reference_configuration: false
SCALAR TRANSPORT DYNAMIC:
  SOLVERTYPE: "nonlinear"
  MAXTIME: 1
  NUMSTEP: 10
  THETA: 1
  SKIPINITDER: true
  LINEAR_SOLVER: 2
SCALAR TRANSPORT DYNAMIC/STABILIZATION:
  STABTYPE: "no_stabilization"
  DEFINITION_TAU: "Zero"
  EVALUATION_TAU: "integration_point"
  EVALUATION_MAT: "integration_point"
SCALAR TRANSPORT DYNAMIC/NONLINEAR:
  CONVTOL: 1e-08
  ABSTOLRES: -1
SCALAR TRANSPORT DYNAMIC/ARTERY COUPLING:
  coupling_method: gauss_point_to_segment
  penalty_parameter: 0
  reaction_terms:
    artery_function_ids: "11"
    artery_scaling: "-1"
    homogenized_function_ids: "13 0"
    homogenized_scaling: "1 0"
ARTERIAL DYNAMIC:
  DYNAMICTYPE: "Stationary"
  SOLVESCATRA: true
  LINEAR_SOLVER: 2
  INITFUNCNO: 2
SOLVER 1:
  NAME: "solver"
  SOLVER: "Belos"
  AZPREC: "Teko"
  SOLVER_XML_FILE: "xml/linear_solver/iterative_gmres_porofluid_pressure_based.xml"
  TEKO_XML_FILE: "xml/block_preconditioner/porofluid_elast_scatra_artery_5field.xml"
  AZREUSE: 10
SOLVER 2:
  SOLVER: "UMFPACK"
  NAME: "solver"
